import './style.css';

function Work() {

   const porefection = {
      title: 'Porefect Skincare',
      deployedLink: 'https://porefect.herokuapp.com'
   }

   return (
      <div className="page">
         <Piece piece={porefection} />
      </div>
   );

}

export default Work;
